          <h2>Overall Results</h2>
          <div id="totals-container" class="totals-container"></div>
        </div>
        <!-- TODO Use only the parts of d3 that we need -->
        <script src="https://d3js.org/d3.v4.min.js"></script>
        <script>
            (function(window, d3) {
              // Choropleth colors
              // This color scheme is from ColorBrewer
              // http://colorbrewer2.org/?type=diverging&scheme=PRGn&n=3
              //
              // I chose it because it was a colorblind safe diverging
              // scheme that avoids red/blue since they are frequently used
              // with partisan races, which seemed inappropriate for a
              // referendum
              var COLOR_YES = '#7fbf7b';
              var COLOR_EVEN = '#f7f7f7';
              var COLOR_NO = '#af8dc3';
              var COLOR_NO_VOTES = '#fff';
              // Create a color scale.  Pass it the yes percentage value
              // to get the color
              var fillColor = d3.scaleQuantize()
                  .domain([0, 1])
                  .range([COLOR_NO, COLOR_YES]);

              // Formatting function so that our fips codes in our results spreadsheet
              // match the `id` attribute of the paths in our SVG.
              // We don't need to mess with this if we can assure that the values in
              // the CSV data are formatted like "001".
              var fpFormat = d3.format('03d');

              // Formating function for percentages
              var pctFormat = d3.format(".1%");

              // Formating function for votes
              var voteFormat = d3.format(",");


              /**
               * Render a results table inside a container.
               *
               * We make this a separate function so we can reuse it for
               * both tooltips and the totals table.
               */
              var renderResultsTable = function(selection, d) {
  selection.html(
    "<h3>" + d.name + "</h3>" +
    "<table>" +
    "<thead>" +
    "<th></th><th>Votes</th><th>%</th>" + "</tr>" +
    "</thead>" +
    "<tr>" +
    "<td>Yes</td>" +
    "<td>" + voteFormat(d.yes) + "</td>" +
    "<td>" + pctFormat(d.yes_pct) + "</td>" +
    "</tr>" +
    "<tr>" +
    "<td>No</td>" +
    "<td>" + voteFormat(d.no) + "</td>" +
    "<td>" + pctFormat(d.no_pct) + "</td>" +
    "</tr>" +
    "</table>"

  );
};

              /**
               * Process raw results so there is one result object per county.
               */
              var getResultsByCounty = function(rawResults) {
                var resultsByCounty = {};
                var counties = [];
                var results;

                rawResults.forEach(function(d) {
                  var candidateProp;
                  var candidatePctProp;
                  var name = d.Type === "County" ? d.CountyName : "Statewide";

                  if (!resultsByCounty[name]) {
                    resultsByCounty[name] = {
                      name: name
                    };

                    if (d.Type !== "Statewide") {
                      counties.push(d.CountyName);
                    }
                  }

                  candidateProp = d.Name === "For the amendment" ? 'yes' : 'no';
                  candidatePctProp = candidateProp + '_pct';

                  resultsByCounty[name][candidateProp] = parseInt(d.Votes, 10);
                  resultsByCounty[name][candidatePctProp] = parseFloat(d.Percentage.replace('%', '')) / 100;
                });

                results = counties.map(function(county) {
                  return resultsByCounty[county];
                });

                return [results, resultsByCounty];
              };

              var svg = d3.select('#container svg');
              var totalsContainer = d3.select('#totals-container');

              // Define the div for the tooltip
              var tooltip = d3.select("body").append("div")
                .attr("class", "tooltip")
                .style("opacity", 0);

              svg.selectAll('path')
                .on("mouseover", function(d) {
                  if (!d) {
                    return;
                  }
                  tooltip.transition()
                    .duration(200)
                    .style("opacity", .9);

                  tooltip.call(renderResultsTable, d)
                    .style("left", (d3.event.pageX) + "px")
                    .style("top", (d3.event.pageY - 28) + "px");
                })
                .on("mouseout", function(d) {
                  tooltip.transition()
                    .duration(500)
                    .style("opacity", 0);
                });

              // TODO: Wrap this in a setTimeout to update the map periodically
              // with new results
              d3.csv('results.csv', function(rawResults) {
                var resultsPack = getResultsByCounty(rawResults);
                var results = resultsPack[0];
                var resultsByCounty = resultsPack[1];

                // Render the total results table
                totalsContainer.call(renderResultsTable, resultsByCounty['Statewide']);
                // Bind our results data to our SVG paths
                // This is where d3 really shines.
                // While the d3 data binding pattern is pretty widely used,
                // using a custom key function, as we do here, is less
                // common.
                // See https://github.com/d3/d3-selection#joining-data
                // for the docs on this
                svg.selectAll('path')
                    .data(results, function(d) {
                      return d ? d.name : this.id;
                    })
                    .attr('fill', function(d) {
                      // Fill with a color based on whether the
                      // jurisdiction is majorty yes or majorty no.
                      if (d.yes_votes === 0 && d.no_votes === 0) {
                        return COLOR_NO_VOTES;
                      }   
                      if (d.yes_pct === d.no_pct) {
                        return COLOR_EVEN;
                      }

                      return fillColor(d.yes_pct);
                    })
                    .attr('fill-opacity', function(d) {
                      // Use the percentage of votes to set the opacity
                      // to visualize the intensity of the voting.
                      // We could do this with the color scale as well.
                      if (d.yes > d.no) {
                        return d.yes_pct;
                      }

                      if (d.no > d.yes) {
                        return d.no_pct;
                      }

                      return 1;
                    });
              });
            })(window, d3);
        </script>
